export type BatScope = {
    status: string;
    __type: string;
    seq: number;
    type: string;
    __messageId: string;
    __properties: object;
    __children: Array<any>;
    __outerIds: object;
    __splitProcess?: boolean;
    __RemoteCall?: boolean;
    __close?: boolean;
    __root: object;
    run?: () => void;
    getTraceContext?: (key?: boolean) => any;
    beforeSend: () => void;
    getInheritValue?: (key: string) => any;
    isCanaryRequest?: () => boolean;
    setRemoteCall?: (msgId: string) => void;
    setTimeOutError?: () => void;
};
export type InfoSec = {
    isFromInfoSec: boolean;
    isOriginatedFromInfoSec: boolean;
    infoSecPrefix: string;
};
export type Store<T> = {
    scope?: BatScope;
    data?: {
        [x: string]: any;
    } | string;
    context?: T;
};
export type timeoutStatsMap = {
    type: string;
    name: string;
    timeoutStats: {
        connectionTimeout?: number;
        socketTimeout?: number;
        requestTimeout?: number;
        connectionPoolBorrowTimeout?: number;
        [key: string]: number;
    };
};
